import { Typography } from "@mui/material";
import React, { useEffect, useState } from "react";
import HeroSectionSimple from "../Components/HeroSectionSimple";
import starback from "../Images/starlink-back.jpg";
import { MapContainer, CircleMarker, TileLayer, Tooltip } from "react-leaflet";
import "leaflet/dist/leaflet.css";

export default function StarlinkPage() {
  const [starLinkData, setStarLinkData] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    (async () => {
      await fetchStars();
    })();
  }, []);

  useEffect(() => {
    console.log(starLinkData);
  }, [starLinkData]);

  async function fetchStars() {
    fetch("https://api.spacexdata.com/v4/starlink")
      .then((res) => res.json())
      .then((res) => {
        setStarLinkData(res);
        setLoading(false);
      });
  }

  return (
    <div>
      <HeroSectionSimple cover={starback} title="Starlink" />
      <Typography
        variant="h2"
        component={"h2"}
        color="white"
        align="center"
        marginTop={10}
      >
        A Live Map of all <br /> StarLink Satellites will be added here
      </Typography>
      <br />
      <br />
      <MapContainer
        style={{ height: "480px", width: "100%" }}
        zoom={1}
        center={[-0.09, 51.505]}
      >
        <TileLayer url="http://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png" />
        {!loading && (
          <CircleMarker color="ffffff" center={[51.505, -0.09]}>
            <Tooltip direction="right" offset={[-8, -2]} opacity={1}>
              <span>hEY</span>
            </Tooltip>
          </CircleMarker>
        )}
      </MapContainer>
    </div>
  );
}
